import React, { useState } from "react";

const SizeSelectOptions = () => {
  // const [size, setSize] = useState(["big", "medium", "small"]);
  const size = ["big", "medium", "small"];
  size.append("massive");
  return size.map(s => <option value={s}>{s}</option>);
};

export default SizeSelectOptions;
